import React from 'react';
import rogo from './../img/rogo.png';

const Home = () => (
  <div>
    <img src={rogo} className="rogo" width="160px" alt="logo" />
    <h1>牛とともに生きる。</h1>
    <h1>食べることは、</h1>
    <h1>生きること。</h1>

  </div>
);

export default Home
